Id_16164 = 16164
titulo_16164 = "Análisis de encadenamientos productivos y multiplicadores de empleo y producción a partir de la matriz insumo producto de Chile 2013"
autor_16164 =  "Velázquez, Adrián Pascual Ricardo"
resumen_16164 =""" 
A partir del modelo Insumo Producto se puede estudiar el efecto sobre el total de la economía de shocks exógenos en la demanda final de bienes de un determinado sector. Para ello se recurre al cálculo de “multiplicadores" que reflejan la amplificación del shock inicial en un sector sobre el resto de la economía a través del flujo de comercio intersectorial. Otro análisis que suele hacerse es el estudio de los llamados “encadenamientos" productivos, por medio del cual se busca identificar la interdependencia que presentan los diferentes sectores, debido a sus requerimientos de insumos.
Este tipo de metodología de análisis es de gran utilidad ya que permite identificar los sectores productivos hacia los cuales podrían dirigirse políticas públicas de apoyo y estímulo, para promover un mayor crecimiento en la actividad económica y en la generación de puestos de trabajo. El trabajo de investigación consiste en un análisis cuantitativo, que abarca el cálculo y análisis de indicadores (encadenamientos y multiplicadores de producción y empleo) a partir de los datos disponibles de la matriz insumo producto de Chile del año 2013, con el objetivo de determinar cuáles son los sectores económicos de este país que estimulan un mayor crecimiento en la producción de otros sectores y en la generación de empleo en su economía. Del análisis de los indicadores se concluye que los sectores que promueven un mayor incremento de producción en la economía son el Agropecuario-silvícola y pesca; la Industria manufacturera; el sector de Electricidad, gas, agua y gestión de desechos; el de Transporte, comunicaciones y servicios de información; la Construcción; y el sector de Comercio, hoteles y restaurantes. De éstos, los dos últimos también estimulan una mayor generación de empleo de mano de obra, y los cuatro primeros son sectores clave por sus encadenamientos tanto hacia atrás como hacia adelante.
"""
link_16164 = "https://bdigital.uncu.edu.ar/16164"

