Id_15912 = 15912
titulo_15912 = "Control interno en los procesos administrativos-contables"
autor_15912 = "Araujo, Roberto Antonio"
resumen_15912 = """
El tema abordado es el Control Interno en los Procesos Administrativos Contables. Demostración de su aplicación práctica en una empresa familiar de materiales de electricidad. Nuestro objetivo general es demostrar la importancia de la implementación del control interno en los procesos administrativoscontables de las empresas. Mientras que los objetivos particulares son enumerar las ventajas y desventajas de un sistema de control interno, evaluar la eficacia y eficiencia de un procedimiento administrativo-contable con un sistema de control interno y el mismo procedimiento sin dicho sistema, explicar la relación entre el control interno y la administración del riesgo empresarial. Para cumplir con los mismos expondremos las definiciones de Control Interno, Gestión de Riesgos Corporativos, Proceso de Compras, Proceso de Pagos, entre otras. La metodología de investigación empleada en este trabajo implica un enfoque cualitativo descriptivo, basado en el análisis documental de diversas fuentes, la experiencia de especialistas en la materia y entrevistas. El resultado de nuestra investigación se relaciona con la importancia de mantener un sistema de control interno eficaz y eficiente, la falta de aplicación práctica del control interno en las organizaciones, el desconocimiento por parte de los empresarios de la gestión de riesgos corporativos y con la formalización de los procesos administrativos.
"""
link_15912 = "https://bdigital.uncu.edu.ar/15912"

