Id_16026 = 16026
titulo_16026 = "Diseño e implementación de un modelo de costeo para la toma de decisiones"
autor_16026 = "Baños, Florencia"
resumen_16026 = """
La presente investigación se realizó sobre la empresa GRANJEROS SRL que se dedica a la producción y comercialización de productos avícolas tanto en canal mayorista como minorista. El problema de la investigación fue que el sistema actual que se utiliza para la determinación de costos, no estaría contemplando la totalidad de los factores de la producción involucrados en el proceso de producción y comercialización de los productos. Para lo cual, el principal objetivo es determinar el costo de los diferentes productos mediante la implementación de un modelo de costeo que permita eficientizar la toma de decisiones en dicha la empresa. Para profundizar sobre el diagnóstico en las organizaciones, y sobre todo en la empresa GRANJEROS SRL, utilizamos las herramientas clásicas y actuales para construir diagnósticos en las organizaciones: la matriz FODA(Fortalezas, Oportunidades, Debilidades y Amenazas) y el modelo de las cinco fuerzas competitivas de PORTER. Luego, indagamos acerca de la Teoría General del Costo (TGC), y se trabajó sobre el Método de Costeo Basado en Actividades (ABC), Gestión Basada en Actividades (ABM) y Gestión Estratégica de Costos (GEC), herramientas que pueden utilizarse para solucionar el problema planteado en la empresa. El carácter de la investigación desde un enfoque descriptivo, se lo clasifica con una orientación cuantitativa, debido a que está centrada en los aspectos objetivos y susceptibles de cuantificación. Puesto que se observan y analizan los fenómenos en su ambiente natural y además, se busca recopilar datos en un momento único, se ubicó dicha investigación en la clasificación no experimental-transeccional, y dentro de este, implementamos un diseño descriptivo.
Para concluir, se le aconseja al ente en cuestión implementar un sistema de costeo basado en actividades, ya que la gestión óptima de las actividades generará una mayor objetividad en la asignación de los costos a los productos correspondientes, en función de las actividades que haya consumido cada línea de producto analizando el costo y su comportamiento a lo largo de la cadena de valor.
"""
link_16026 = "https://bdigital.uncu.edu.ar/16026"

