Id_15993 = 15993
titulo_15993 = "El sistema de control en el Departamento de Aranceles del Hospital Dr. Humberto J. Notti, Mendoza"
autor_15993 = "Romero, Johanna Beatriz"
resumen_15993 = """
El sistema de control interno puede ser aplicado para cualquier empresa indistinto de su tamaño o trayectoria y es visto más como una solución a una variedad de problemas potenciales. La presente investigación se propone indagar el problema, de las carencias de un control en los procesos del Departamento de Aranceles del Hospital Dr. Humberto J. Notti. Con el objetivo de reconocer y proponer mejoras en su sistema control. El presente estudio consiste en un análisis cuantitativo descriptivo. Como punto de partida el informe de las prácticas de trabajo en el Departamento de Aranceles del hospital, en el año 2017, realizado por la presente estudiante. Luego, se explorará la bibliografía disponible complementando con las observaciones y relevamiento de información interna, además, entrevistas realizadas a responsables de los sectores y otros colaboradores involucrados. Se evaluarán las formas de calidad del servicio, es decir eficiencia del proceso y asimismo la relación con la mejora de la motivación, comunicación y desempeño del personal del departamento del hospital público. Los resultados indican que la necesidad e importancia del control en los procesos del departamento ayuda a la organización a lograr sus metas en cuento a desempeño, rentabilidad y prevenir pérdida de recursos. Además, ayuda a asegurar que la organización cumpla con leyes y regulaciones, evitando daño a su reputación, perdida de recurso y tiempo. En fin, ayuda a llegar donde se quiere ir y evitar obstáculos a lo largo del camino.
"""
link_15993 = "https://bdigital.uncu.edu.ar/15993"

