Id_16129 = 16129
titulo_16129 = "Índice de actividad económica de Mendoza, por análisis de componentes principales"
autor_16129 = "Deluret, Fernando Javier"
resumen_16129 = """
El presente trabajo tiene por objetivo la construcción de un Índice de Actividad Económica (IAEMEN) para la provincia de Mendoza, el cual será de periodicidad mensual. En la actualidad no se ha publicado para la provincia ningún indicador de actividad económica de periodicidad menor a la anual. Esta investigación intenta presentar un aporte útil para satisfacer la necesidad de información actualizada de la situación económica regional. La metodología usada para la construcción del índice es el Análisis de Componentes Principales a partir de una serie de variables que se consideran representativas de la actividad económica de Mendoza, las cuales se encuentran disponibles en forma oportuna y tienen una periodicidad mensual en su publicación. El análisis de componentes principales (ACP) es un método de reducción de dimensionalidad lineal de los datos. El objetivo es poder reducir el número de variables necesarias para representar un conjunto de datos. Adicionalmente al objetivo inicial que era la construcción del índice se agregó, durante el desarrollo del trabajo, la compilación de la teoría del Análisis de Componentes Principales. Esto debido a que no existía una bibliografía en español que cubriera los diferentes aspectos del tema integrados. Como resultados del trabajo se logró construir un índice que captara los patrones de comportamiento particulares de la economía provincial, y se detectó un aparente rezago entre los movimientos de la economía de Mendoza respecto a la nacional.
"""
link_16129 = "https://bdigital.uncu.edu.ar/16129"

