Id_15952 = 15952
titulo_15952 = "Las fuentes de financiamiento de la provincia de Mendoza (2004-2016)"
autor_15952 = "Ambrogetti, Florencia"
resumen_15952 = """
Las fuentes de financiamiento de la provincia de Mendoza, constantemente, son objeto de estudio de distintos organismos tanto gubernamentales como independientes. La presente investigación se propone analizar el impacto de las modificaciones del régimen de distribución de recursos nacionales en la provincia de Mendoza entre los años 2004-2016. El estudio consiste en un análisis macrosocial, diacrónico- retrospectivo y descriptivo. A partir de datos publicados por organismos oficiales, se realiza un análisis estadístico. Los datos deben ser homogeneizados para realizar correctas comparaciones entre los años mencionados. Los resultados obtenidos muestran que: la provincia de Mendoza, solo con sus recursos de origen provincial, no puede hacer frente a la totalidad de gastos, para lograrlo necesita de la transferencia de forma automática o no, por parte de la nación. En estas trasferencias se encuentran las obtenidas por la coparticipación federal, y se observa que los aportes de la provincia son mayores a lo que se obtiene por este concepto.
"""
link_15952 = "https://bdigital.uncu.edu.ar/15952"

